  false,\n\t\"url\": null,\n\t\"notes\": \" n        This performance evaluation uses
  a pre-post methodology to evaluate the functional literacy subactivity of the Artisan
  and Fez Medina Project. The evaluation followed the Kirkpatrick model trying to
  assemble a set of qualitative and quantitative evidence. To do so the evaluation
  team questioned 6 main criteria : relevance, coherence, efficiency, effectiveness,
  impact and sustainability and also assessed the program gender and environment approaches.
  17 focus groups, 500 respondents to a survey and 70 semi-structured interviews contributed
  to collect primary and secondary sources of information so to triangulate findings.n
